import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Nav from './components/nav';
import Welcoming from '../src/components/welcoming/welcomingHomePage';
/*import Trainee from '../src/components/trainee/opportunity';
import Company from'../src/components/company/appliedTrainee';*/
import SignUp from'../src/components/signIn-signUp/routeSignUp';

const App = () => {
  return (
   <Router>
   <div>
    <Nav /> 
    <Welcoming />
    <Route path='/SignUp' component={SignUp} />
    </div>
   </Router>
  );
}

export default App;
